// CaseOpened.js
import React from 'react';
import './styles/Case_opened.css';

import freecase1 from '../assets/case/freecase1.png';

import tier1 from '../assets/frame/tier1.png';
import tier2 from '../assets/frame/tier2.png';
import tier3 from '../assets/frame/tier3.png';
import tier4 from '../assets/frame/tier4.png';
import tier5 from '../assets/frame/tier5.png';

// SkinTier component defined inside CaseOpened.js
const SkinTier = ({ tier, images }) => (
  <div className={`tier${tier}`}>
    {images.map((image, index) => (
      <img key={index} src={image}/>
    ))}
  </div>
);

function Case_Opened(){
    return(
        <>
            <div className="opencase">
                <h1>Freecase1</h1>
                <img src={freecase1} alt="" />
                <button>Open $0.00</button>
            </div>

            <div class="case_item">
                <div class="image-container">
                    <img src="./img/skin/Freecase1/tier1/DE_BluePly.png" class="tier1"/>
                    <img src="./img/skin/Freecase1/tier1/glock_oxide.png" class="tier1"/>
                    
                    <img src="./img/skin/Freecase1/tier2/p2000_aced.png" class="tier2"/>
                    <img src="./img/skin/Freecase1/tier2/mac7_monster.png" class="tier2"/>
                    <img src="./img/skin/Freecase1/tier2/tec9_avalanche.png" class="tier2"/>
                    
                    <img src="./img/skin/Freecase1/tier3/glock_neonoir.png" class="tier3"/>
                    <img src="./img/skin/Freecase1/tier3/m4_rain.png" class="tier3"/>
                    <img src="./img/skin/Freecase1/tier3/mac10_fade.png" class="tier3"/>

                    <img src="./img/skin/Freecase1/tier4/awp_asiimov.png" class="tier4"/>
                    <img src="./img/skin/Freecase1/tier4/m4s4_rain.png" class="tier4"/>

                    <img src="./img/skin/Freecase1/tier5/karam_saber.png" class="tier5"/>
                    <img src="./img/skin/Freecase1/tier5/navaja_fade.png" class="tier5"/>
                </div>
            </div>
        </>
    );
}

export default Case_Opened;
